import React from "react";
import styled from "styled-components";

const Lines = styled.div`
  width: 5rem;
  height: 5rem;
  background: black;
`;

const Footer = () => {
  return (
    <div>
      <Lines />
      <h1>I am footer</h1>
    </div>
  );
};

export default Footer;
